<script setup lang="ts">
import {onMounted, onUnmounted, ref} from "vue"

const colors = ["white", "red", "yellow", "green"];
const currentColorCounter = ref(0);

const schema = ref(null)
const viewboxWidth = ref<number>(1000)
const viewboxHeight = ref<number>(1000)
const viewboxX = ref<number>(0)
const viewboxY = ref<number>(0)
const isMove = ref<boolean>(false)
const lastMouseEvent = ref()
const interval = ref()

onMounted(() => {
	window.addEventListener('mousewheel', handleScroll);
})
onUnmounted(() => {
	window.removeEventListener('mousewheel', handleScroll);
})

const handleScroll = (wheelEvent: WheelEvent) => {
 		const zoomScale = 1.1;

		wheelEvent.stopPropagation();

    let zoomX = wheelEvent.offsetX;
    let zoomY = wheelEvent.offsetY;
		let zoomDirection = wheelEvent.deltaY;

		let scaledViewboxWidth, scaledViewboxHeight, scaledViewboxX, scaledViewboxY;

		let zoomLeftFraction = zoomX / schema.value.clientWidth;
    let zoomTopFraction = zoomY / schema.value.clientHeight;

		if(zoomDirection < 0) {
			scaledViewboxWidth = viewboxWidth.value / zoomScale;
      scaledViewboxHeight = viewboxHeight.value / zoomScale;

      scaledViewboxX = viewboxX.value + ((viewboxWidth.value - scaledViewboxWidth) * zoomLeftFraction);
      scaledViewboxY = viewboxY.value + ((viewboxHeight.value - scaledViewboxHeight) * zoomTopFraction);
    } else {
			scaledViewboxWidth = viewboxWidth.value * zoomScale;
      scaledViewboxHeight = viewboxHeight.value * zoomScale;

      scaledViewboxX = viewboxX.value - ((scaledViewboxWidth - viewboxWidth.value) * zoomLeftFraction);
      scaledViewboxY = viewboxY.value - ((scaledViewboxHeight - viewboxHeight.value) * zoomTopFraction);
    }

		viewboxWidth.value = scaledViewboxWidth;
		viewboxHeight.value = scaledViewboxHeight;
		viewboxX.value = scaledViewboxX;
		viewboxY.value = scaledViewboxY;
}

const pointerMove = (e) => {
	if(isMove.value) {
		let mouseDeltaX = e.clientX - lastMouseEvent.value.clientX;
		let mouseDeltaY = e.clientY - lastMouseEvent.value.clientY;
		
		viewboxX.value = viewboxX.value - mouseDeltaX;
		viewboxY.value = viewboxY.value - mouseDeltaY;
	}
}

const pointerDown = (e: any) => {
	isMove.value = true;
	lastMouseEvent.value = e;
}

const pointerUp = e => {
	isMove.value = false;
}

const changeColor = () => {
	const elements = [...schema.value.getElementsByTagName("g")].filter(item => item.getAttribute("data-type") == 41);

	for(let i = 0; i < elements.length; i++) {
		[...elements[i].children][0].style.fill = colors[currentColorCounter.value];
	}

	currentColorCounter.value = currentColorCounter.value === colors.length - 1 ? 0 : currentColorCounter.value + 1;
}

const clickHandle = () => {
	if(interval.value) {
		clearInterval(interval.value)
		interval.value = null
	} else {
		interval.value = setInterval(changeColor, 750)
	}
}
</script>

